import React from "react";

import  { useState,useEffect } from 'react';

import {Link} from "react-router-dom";



function Welcome() {







  return (


      <main className='container top1'>

          <div className='row'>
                <div className='col-12'>
                    <h5>Add a new Household </h5>
                </div>                            
          </div>

          <form method='post' action='/api/postHousehold' className='row'>
                    <label for='householdName'>Household Name
                        <input className='col-12' type='text' id='householdName' name='householdName'></input>
                    </label>

                    <label className='top1' for='default'> Make default

                        <input className='col-12' type='checkbox'></input>

                    </label>

                    <button className='top1 col-12 border button-secondary' type='submit'>Add</button>

          </form>



      </main>    
  );
}

export default Welcome;
